Let‚Äôs start again with a flake: ./flake.nix { inputs.std.url = "github:divnix/std"; inputs.nixpkgs.url = "nixpkgs"; outputs = {std, ...} @ inputs: /* brings std attributes into scope namely used here: `growOn`, `harvest` & `blockTypes` */ with std; /* grows a flake "from cells" on "soil"; see below... */ growOn { /* we always inherit inputs and expose a deSystemized version via {inputs, cell} during import of Cell Blocks. */ inherit inputs; /* from where to "grow" cells? */ cellsFrom = ./nix; /* custom Cell Blocks (i.e. "typed outputs") */ cellBlocks = [ (blockTypes.devshells "devshells") (blockTypes.nixago "nixago") ]; /* This debug facility helps you to explore what attributes are available for a given input untill you get more familiar with `std`. */ debug = ["inputs" "std"]; } /* Soil is an idiom to refer to compatibility layers that are recursively merged onto the outputs of the `std.grow` function. */ # Soil ... # 1) layer for compat with the nix CLI { devShells = harvest inputs.self ["automation" "devshells"]; } # 2) there can be various layers; `growOn` is a variadic function {};
} This time we specified cellsFrom = ./nix;. This is gentle so that our colleagues know immediately which files to either look or never look at depending on where they stand. We also used std.growOn instead of std.grow so that we can add compatibility layers of ‚Äúsoil‚Äù. Furthermore, we only defined two Cell Blocks: nixago & devshells. More on them follows‚Ä¶ ./nix/automation/* Next, we define a automation cell. Each project will have some amount of automation. This can be repository automation, such as code generation. Or it can be a CI/CD specification. In here, we wire up two tools from the Nix ecosystem: numtide/devshell & nix-community/nixago . Please refer to these links to get yourself a quick overview before continuing this tutorial, in case you don‚Äôt know them, yet. A very short refresher: Nixago : Template & render repository (dot-)files with nix. Why nix? Devshell : Friendly & reproducible development shells ‚Äî the original ‚Ñ¢. Some semantic background: Both, Nixago & Devshell are Component Tools . (Vertical) Component Tools are distinct from (Horizontal) Integration Tools ‚Äî such as std ‚Äî in that they provide a specific capability in a minimal linux style: ‚ÄúDo one thing and do it well.‚Äù Integration Tools however combine them into a polished user story and experience. The Nix ecosystem is very rich in component tools , however only few integration tools exist at the time of writing. ./nix/automation/devshells.nix Let‚Äôs start with the cell.devshells Cell Block and work our way backwards to the cell.nixago Cell Block below. More semantic background: I could also reference them as inputs.cells.automation.devshells & inputs.cells.automation.nixago. But, because we are sticking with the local Cell context, we don‚Äôt want to confuse the future code reader. Instead, we gently hint at the locality by just referring them via the cell context. { inputs, cell,
}: let /* I usually just find it very handy to alias all things library onto `l`... The distinction between `builtins` and `nixpkgs.lib` has little practical relevance, in most scenarios. */ l = nixpkgs.lib // builtins; /* It is good practice to in-scope: - inputs by *name* - other Cells by their *Cell names* - the local Cell Blocks by their *Block names*. However, for `std`, we make an exeption and in-scope, despite being an input, it's primary Cell with the same name. */ inherit (inputs) nixpkgs; inherit (inputs.std) std; inherit (cell) nixago;
in # we use Standard's mkShell wrapper for its Nixago integration l.mapAttrs (_: std.lib.mkShell) { default = {...}: { name = "My Devshell"; # This `nixago` option is a courtesy of the `std` horizontal # integration between Devshell and Nixago nixago = [ # off-the-shelve from `std` (std.nixago.conform {configData = {inherit (inputs) cells;};}) std.nixago.lefthook std.nixago.adrgen # modified from the local Cell nixago.treefmt nixago.editorconfig nixago.mdbook ]; # Devshell handily represents `commands` as part of # its Message Of The Day (MOTD) or the built-in `menu` command. commands = [ { package = nixpkgs.reuse; category = "legal"; /* For display, reuse already has both a `pname` & `meta.description`. Hence, we don't need to inline these - they are autodetected: name = "reuse"; description = "Reuse is a tool to manage a project's LICENCES"; */ } ]; # Always import the `std` default devshellProfile to also install # the `std` CLI/TUI into your Devshell. imports = [std.devshellProfiles.default]; }; } The nixago = []; option in this definition is a special integration provided by the Standard‚Äôs devshell-wrapper (std.lib.mkShell) . This is how std delivers on its promise of being a (horizontal) integration tool that wraps (vertical) component tools into a polished user story and experience. Because we made use of std.harvest in the flake, you now can actually test out the devshell via the Nix CLI compat layer by just running nix develop -c "$SHELL" in the directory of the flake. For a more elegant method of entering a development shell read on the direnv section below. ./nix/automation/nixago.nix As we have seen above, the nixago option in the cell.devshells Cell Block references Targets from both std.nixago and cell.nixago. While you can explore std.nixago here , let‚Äôs now have a closer look at cell.nixago: { inputs, cell,
}: let inherit (inputs) nixpkgs; inherit (inputs.std) std; /* While these are strictly specializations of the available Nixago Pebbles at `std.nixago.*`, it would be entirely possible to define a completely new pebble inline */
in { /* treefmt: https://github.com/numtide/treefmt */ treefmt = std.nixago.treefmt { # we use the configData attribute to modify the # target data structure via a simple data overlay # (`divnix/data-merge` / `std.dmerge`) mechanism. configData.formatter.go = { command = "gofmt"; options = ["-w"]; includes = ["*.go"]; }; # for the `std.lib.mkShell` integration with nixago, # we also hint which packages should be made available # in the environment for this "Nixago Pebble" packages = [nixpkgs.go]; }; /* editorconfig: https://editorconfig.org/ */ editorconfig = std.nixago.editorconfig { configData = { # the actual target data structure depends on the # Nixago Pepple, and ultimately, on the tool to configure "*.xcf" = { charset = "unset"; end_of_line = "unset"; insert_final_newline = "unset"; trim_trailing_whitespace = "unset"; indent_style = "unset"; indent_size = "unset"; }; "{*.go,go.mod}" = { indent_style = "tab"; indent_size = 4; }; }; }; /* mdbook: https://rust-lang.github.io/mdBook */ mdbook = std.nixago.mdbook { configData = { book.title = "The Standard Book"; }; };
} In this Cell Block, we have been modifying some built-in convenience std.nixago.* pebbles. The way configData is merged upon the existing pebble is via a simple left-hand-side/right-hand-site data-merge (std.dmerge). Background on array merge strategies: If you know how a plain data-merge (does not magically) deal with array merge semantics, you noticed: We didn‚Äôt have to annotate our right-hand-side arrays in this example because we where not actually amending or modifying any left-hand-site array type data structure. Would we have done so, we would have had to annotate: either with std.dmerge.append [/* ... */]; or with std.dmerge.update [ idx ] [/* ... */]. But lucky us (this time)!

