Cell Block: (blockType.installables "packages")
Location: **/packages.nix # or **/packages/
Actors: - Build Expert Panel, Nix- & language-specific - Release Manager This Cell Block builds, unit-tests & packages the application via the appropriate Nix primitives . Each programming language has a different best practice approach to packaging. Therfore, a fair ammount of domain knowledge between Nix and the language‚Äôs build system is required. The location of the actual build instructions are secondary. At minimum, though, for transparency‚Äôs and uniformity‚Äôs sake, they are still proxied via this Cell Block. So in the case that upstream already contains appropriate build instructions, the following indirection is perfectly valid (and necessary): { inputs, cell }: { app = inputs.upstream.packages.some-app;
} Build instructions themselves should encompass executing unit tests. Builds that fail unit tests should already be filtered out at this layer (i.e. ‚Äúa build that fails unit tests is no build, at all‚Äù). A Release Manager may decide to provide these artifacts to the general public on tagged releases. In a hurry? Fetching binary artifacts and incorporating them at this layer as a temporary work-around for non-production enviornments is acceptable.

