Cell Block: (blockType.containers "oci-images")
Location: **/oci-images.nix # or **/oci-images/
Actors: - Operator - Release Manager This layered packaging pattern promotes source-based distribution in principle. Despite, in common operating scenarios, we require a security stop-gap separation. This ensures very fundamentally that nothing is accidentially built on the target (production) worker node, where it would cannibalize critical resources. We chose OCI-Images as the binary distribution format. It not only fits that purpose through the OCI Distribution Specification , but also collaterally procures interoperability for 3rd parties: OCI images are the de-facto industry standard for deployment artifacts. If the entrypoints have been created via the above mentioned library function , the creation of OCI images trivially reduces to: { inputs, cell }: { image-hard = cell.entrypoints.app.mkOCI "docker.io/my-image-hardened"; image = cell.entrypoints.app.mkDebugOCI "docker.io/my-image";
} Alternatively, any of the avaible Nix-based OCI generation mini-frameworks can be used; nlewo/nix2container being the recommended one. Hence, this mini-framework is internally used by the entrypoints library function. A Release Manager may decide to provide these artifacts to the general public on tagged releases. In a hurry? Fetching published images and incorporating them at this layer as a temporary work-around for non-production enviornments is acceptable.

