All inputs are scoped for the current system, that is derived from the systems input list to std.grow. That means contrary to the usual nix-UX, in most cases, you don‚Äôt need to worry about system. The current system will be ‚Äúlifted up‚Äù one level, while still providing full access to all systems for cross-compilation scenarios. # inputs.a.packages.${system}
{ inputs.a.packages.pkg1 = {}; inputs.a.packages.pkg2 = {}; /* ... */ inputs.a.packages.${system}.pkgs1 = {}; inputs.a.packages.${system}.pkgs2 = {}; /* ... */
} deSystemize‚Äôs implementation let l = builtins; /* A helper function which hides the complexities of dealing with 'system' properly from you, while still providing escape hatches when dealing with cross-compilation. You can use this function independently of the rest of std. */ deSystemize = let iteration = cutoff: system: fragment: if ! (l.isAttrs fragment) || cutoff == 0 then fragment else if l.hasAttr "${system}" fragment && ! l.isFunction fragment.${system} then fragment // fragment.${system} else if l.hasAttr "${system}" fragment && l.isFunction fragment.${system} then fragment // {__functor = _: fragment.${system};} else l.mapAttrs (_: iteration (cutoff - 1) system) fragment; in iteration 3;
in deSystemize

